import React from "react";
import "./Hotel.css";

const Hotel = (props) => {
  return (
    <div>
      <img src={props.item.image_url} alt=""></img>
      <a href="#">
        <h5>{props.item.name}</h5>
      </a>
      <p>{props.item.city}</p>
      <p>{props.item.price}</p>
      <div>
        {props.item.rate} {props.item.type}
      </div>
    </div>
  );
};

export default Hotel;
